import React from 'react';
import { Link } from 'react-router-dom';

function Palvelu() {
    return (
        <div style={{ padding: '20px' }}>
            <h1>Käyttäjien hallintajärjestelmä</h1>
            <ul>
                <li><Link to="/">Kotisivu</Link></li>
                <li><Link to="/rekisterointi">Rekisteröinti</Link></li>
                <li><Link to="/kirjautuminen">Kirjautuminen</Link></li>
                <li><Link to="/hallinta">Käyttäjien hallinta</Link></li>
            </ul>

            <h2>Palvelusivu</h2>
            <p>Tervetuloa palvelusivulle! Tämä on sivu, jolla on käytettävissä vain kirjautuneille käyttäjille.</p>

            <h3>Käyttäjän tiedot</h3>
            <p>Täällä voit tarkastella ja hallita tietojasi.</p>
            <button style={{ marginBottom: '20px' }}>Hallitse profiilia</button>

            <h3>Toiminnot</h3>
            <p>Tarjoamme erilaisia toimintoja kirjautuneille käyttäjille.</p>
            <button>Suorita toiminto</button>
        </div>
    );
}

export default Palvelu;
